import React from 'react';
import logo42 from './assets/images/logo-42.png';
import './assets/styles/navbar.css'

export function NavBar()
{
	return (
		<nav id='navBar'>
			<div>Webserv</div>
			<img id='navLogo' src={logo42} alt='logo-42'></img>
		</nav>
	)
}
